import React,{ Suspense, lazy } from 'react';
import logo from './logo.svg';
import { BrowserRouter as Router, Route } from 'react-router-dom'
import LoadingPage from './components/LoadingPage'

const Navbar = lazy(() => import('./components/Navbar'))
const Sidebar = lazy(() => import('./components/Sidebar'))
const Footer = lazy(() => import('./components/Footer'))
// const Dashboard = lazy(() => import('./pages'))

import Dashboard from './pages/Dashboard'
import ListChapters from './pages/chapters/List'
import AddChapter from './pages/chapters/AddChapter'

function App() {
  return (
    <>
      <Router>
        <Suspense fallback={<LoadingPage />}>
          <Navbar />
          <Sidebar />
          <Route path='/dashboard' component={Dashboard} />
          <Route path='/list-chapters' component={ListChapters} />
          <Route path='/add-chapters' component={AddChapter} />
          <Footer />  
        </Suspense>
      </Router>
    </>
  );
}

export default App;
